import { connect } from 'react-redux';
import { withRouter } from 'react-router-dom';
import { Route, HashRouter as Router } from 'react-router-dom';

import Map from '../Map/Map';
import Draw from '../Draw/Draw';

import Step1 from './components/Step1/Step1';
import Step2 from './components/Quote/Step2/Step2';
import Step3 from './components/Quote/Step3/Step3';
import Step4 from './components/Quote/Step4/Step4';
import Step5 from './components/Quote/Step5/Step5';
import Step6 from './components/Quote/Step6/Step6';
import Step7 from './components/Quote/Step7/Step7';
import Step8 from './components/Quote/Step8/Step8';
import Step9 from './components/Quote/Step9/Step9';
import Step10 from './components/Step10/Step10';


function Quote(props) {

  return (
    <div className='quote'>
      <button onClick={() => props.history.push('/step1')}>Start Quote</button>
      <Router>
        <Route exact path={'/quote/step1'} component={Step1} />
        <Route exact path='/step2' component={Step2} />
        <Route exact path='/step3' component={Step3} />
        <Route exact path='/step4' component={Step4} />
        <Route exact path='/step5' component={Step5} />
        <Route exact path='/step6' component={Step6} />
        <Route exact path='/step7' component={Step7} />
        <Route exact path='/step8' component={Step8} />
        <Route exact path='/step9' component={Step9} />
        <Route exact path='/step10' component={Step10} />
        {/* End Quote Components */}
      </Router>
    </div>
  );
}

export default connect()(withRouter(Quote));
